REMINDER- High School Football helmet checkout and locker assignments will be tomorrow, Sunday, August 9th. Times are as follows:
Seniors: 2:30 pm- 3:00 pm;
Juniors: 3:00 pm - 3:30 pm;
Sophomores: 3:30 pm - 4:00 pm &
Freshmen: 4:00 pm
Those who cannot make it Sunday should arrive at 7:30 am on Monday, August 10th. Practice begins at 8:00 am.

